import TodoForm from "./TodoForm";
import Todo from "./Todo";

function TodoList(todos, updateTodo, removeTodo) {

  return (
    <>
      {todos.map((todo) => (
        <Todo todo={todo} updateTodo={updateTodo} removeTodo={removeTodo} />
      ))}
    </>
  );
}

